  const isMobile = isMobileDevice();
  return (
    <Grid className={isMobile ? styles.card_mobile : styles.card_desktop}>
      <Card color="success">
        HelloHelloHelloHelloHelloHelloHelloHelloHelloHelloHelloHelloHelloHelloHelloHelloHello
      </Card>
    </Grid>
  );
};

